function ensureMorphs() {
    this.removeAllMorphs();
    if (this.submorphs.length === 0) {
        for (var i = 0; i < 10; i++) {
            var m = lively.morphic.Morph.makeRectangle(i * 15, i * 15, 30, 30);
            m.setOpacity(0.5);
            this.addDraggingBehavior(m);
            this.addMorph(m);
        }
    }
    var cpy = this.get("sizeSlider").copy();
    this.get("sizeSlider").remove();
    cpy.setName("sizeSlider");
    this.owner.addMorph(cpy);

    this.submorphs[0].setPosition(pt(0, 0));
}

