function addConstraints() {
    var deltablue = new DBPlanner(), sizeSlider = this.get("sizeSlider");
    this.submorphs.each(function(ea, idx) {
        if (idx === 0) return;
        var other = this.submorphs[idx - 1], that = this;
        bbb.always({
            solver: deltablue,
            methods: function() {
                ea.getPosition().formula([ other.getPosition() ], function(pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 90, ea);
                });
                other.getPosition().formula([ ea.getPosition() ], function(pos, out) {
                    return that.moveAlongLine(pos, out, sizeSlider.value * 90, other);
                });
            },
            ctx: {
                idx: idx,
                deltablue: deltablue,
                ea: ea,
                other: other,
                that: that,
                sizeSlider: sizeSlider,
                _$_self: this.doitContext || this
            }
        }, function() {
            return ea.getPosition().dist(other.getPosition()) < sizeSlider.value * 90;;
        });
    }.bind(this));
}

